import React from "react";
import "./style.css";

const Footer = () => {
  return (
    <footer className="footer text-center">
      <div className="container" id="footer-container">
        <span className="text-muted">
          ©️ 2022 Made with ❤️ Clifftography
        </span>
      </div>
    </footer>
  );
};

export default Footer;
